import React from 'react'

const idCard = (imageName, title, subtitle) => {
  return (
    <div className=''>
      <img src="./assets/images/${imageName}" alt="" />
      <h1 >{title}</h1>
      <h2>{subtitle}</h2>

    </div>
  )
}

export default idCard
